import Login from "./features/login/Login";
import Banner from "./components/Banner";
import { useEffect, useState } from "react";
import Dashboard from "./features/dashboard/Dashboard";
import { SESSION } from "./constants/AppConstants";

const App = () => {
  const [token, setToken] = useState();

  useEffect(() => {
    sessionStorage.setItem(SESSION.SESSION_TOKEN, null);
  }, [token]);

  const testHandle = () => {
    console.log("1st: " + token);
    setToken(null);
    sessionStorage.setItem(SESSION.SESSION_TOKEN, null);
    console.log("2nd: " + token);
  };
  /**
   * Function controls the login of the application screen
   * @param {string} token
   * @returns
   */
  const getScreen = (token) => {
    if (token) {
      return <Dashboard setToken={testHandle} />;
    } else {
      return <Login setToken={setToken} />;
    }
  };

  return (
    <div className="App">
      <Banner />
      {getScreen(token)}
    </div>
  );
};

export default App;
